import React from "react";
import "./welcome.scss";

import { Link } from "react-router-dom";

import backIcon from './assets/backicon.png';


export default function Welcome() {
    return (
        <div className='welcome'>
            <div className="container">

                <img src={backIcon} alt="backicon" style={{float : "left", font:"red"}}/>

                <div className="mainTitle centerText">Welcome</div>

                <div className="usernameTitle centerText">johnsmith</div>

                <div className="labelText">Password</div>

                <input type="password" required />

                <button type="submit">Next</button>

            </div>

            <div className="centerText commonLabels">
                New to Autodesk ?  <Link to="/">Create account</Link>
            </div>

            <div className="footer commonLabels">
                <p>Your account for everything Autodesk</p>
                <a href={''} >Learn More</a>
            </div>

        </div>
    );
}
